import { Redirect } from 'react-router-dom'

const DashboardKlienti = (props) => {
    if(props.name === ''){
        return <Redirect to="restorantidashboard" />
    }
    return ( 
        <div>Hello world</div>
     );
}
 
export default DashboardKlienti;
